<body>
<div id="app">
	<table>
		<tr>
			<th>Status Code</th>
			<th>Canal</th>
			<th>URL</th>
		</tr>
		<tr v-for="i in tv">
			<td>{{i[3]}}</td>
			<td>{{i[5]}}</td>
			<td><a :href="i[7]">{{i[7]}}</a></td>
		</tr>
	</table>
</div>
<script>
new Vue({
	el: '#app',
	data () {
		return {
			tv: {}
		}
	},
	methods: {
		async fetch_php() {
			const url = "https://cors-anywhere.herokuapp.com/https://www.apps4two.com/apps/tvonline/ch_channel.php"
			const res = await fetch(url);
			const json = await res.json();
			this.tv = json;
			for (let i = 0; i < json.length; i++) {
				try {
					if (json[i][7]) {
						const status_code = await fetch("https://cors-anywhere.herokuapp.com/"+json[i][7]);
						console.log(status_code)
						Vue.set(this.tv[i], 3, status_code.status)
					} else {
						Vue.set(this.tv[i], 3, "")
					}
				} catch(e) {
					Vue.set(this.tv[i], 3, status_code.status)
				}
			}
		}
	},
	mounted () {
	this.fetch_php();
	}
})
</script>
